// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.3;

interface IERC20 {
  //Quando chamada por um usurio, a funo acima retorna o fornecimento total de tokens do contrato.
  function totalSupply() external view returns(uint256);

  //Quando chamada, ela retorna o saldo de tokens dos endereos correspondentes. 
  //Lembre-se, as contas da rede Ethereum so pblicas, portanto voc pode consultar o saldo de qualquer usurio desde que saiba o endereo.
  function balanceOf(address account) external view returns(uint256);

  //A funo transfer transfere tokens de um usurio a outro. Voc fornece o valor e o endereo para o qual deseja transferir.
  //Quando chamada, a funo transfer executa o que chamamos de event (neste caso, um evento de transferncia), 
  //que basicamente diz  blockchain para incluir uma referncia a ele no registro.
  function transfer(address to, uint256 quantity) external returns(bool);

  function transferFrom(address from, address to, uint256 value) external returns (bool);
  function approve(address spender, uint256 value) external returns (bool);
  function allowance(address _owner, address _spender) external view returns (uint256 remaining);

  event Transfer(address from, address to, uint256 value);
  event Approval(address owner, address spender, uint256 value);
}

contract RenewableEnergyToken is IERC20 {

  //Properties
  string public constant name = "RenewableEnergyToken";
  string public constant symbol = "RET";
  uint8 public constant decimals = 2;  //Padro do Ether  18
  uint256 private totalsupply;
  address private admin;

  mapping(address => uint256) private addressToBalance;

  //Constructor
  constructor() {
    totalsupply = 500000;
    addressToBalance[msg.sender] = totalsupply;
  }

  //Public Functions
  function totalSupply() public override view returns(uint256) {
    return totalsupply;
  }

  function balanceOf(address account) public override view returns(uint256) {
    return addressToBalance[account];
  }

  function transfer(address to, uint256 quantity) public override returns(bool) {
    require(addressToBalance[msg.sender] >= quantity, "Saldo insuficiente para transferir");

    addressToBalance[msg.sender] = addressToBalance[msg.sender] - quantity;
    addressToBalance[to] = addressToBalance[to] + quantity;

    emit Transfer(msg.sender, to, quantity);
    return true;
  }

  // Owner de conta aprova transferncia de valor para outra conta
  mapping(address => mapping (address => uint256)) private allowed;

  // Permita que 'spender' saque sua conta, vrias vezes, at o valor 'value'.
  function approve(address spender, uint256 value) public override returns (bool) {
    allowed[msg.sender][spender] = value;

    emit Approval(msg.sender, spender, value);
    return true;
  }

  // Envie a quantidade de tokens 'value' do endereo 'to' para endereo 'from'
  function transferFrom(address from, address to, uint value) public override returns (bool) {
    addressToBalance[from] = addressToBalance[from] - value;
    allowed[from][msg.sender] = allowed[from][msg.sender] - value;
    addressToBalance[to] = addressToBalance[to] + value;

    emit Transfer(from, to, value);
    return true;
  }

  function allowance(address owner, address spender) public override view returns (uint256 remaining){
    return allowed[owner][spender];
  }
}
